import Header from "../../components/Header";
import { Box } from "@mui/material";
const Dashborad = () => {
    return <Box m="20px">
        <Box>
            <Header title="DASHBOARD" subtitle="Welcom to your dashboard GazPromNeft"/>
        </Box>
        
    </Box>
}

export default Dashborad;
